func isPalindrome(s string) bool {
  cleanedStr := ""
  for _, ch := range s {
    if unicode.IsLetter(ch) || unicode.IsDigit(ch) {
      cleanedStr += string(unicode.ToLower(ch))
    }
  }

  // 문자열을 리버스하여 비교합니다.
  reversedStr := ""
  for i := len(cleanedStr) - 1; i >= 0; i-- {
    reversedStr += string(cleanedStr[i])
  }

  return cleanedStr == reversedStr
}

