import "fmt"
import "sort"
func groupAnagrams(strs []string) [][]string {
    hashmap := make(map[string][]string)
    for _, str := range strs {
      s := strings.Split(str, "")
      sort.Strings(s)
      key := strings.Join(s, "")
       hashmap[key]  =append(hashmap[key],str)

    }

    list := make([][]string, 0, len(hashmap))

    for  _, value := range hashmap {
      list = append(list, value)
    }
    return list
}

